// 时间复杂度：O（n）
// 空间复杂度：O（1）
func findString(words []string, s string) int {
	for i, word := range words {
		if word == s {
			return i
		}
	}

	return -1
}

// 时间复杂度：O（log n）
// 空间复杂度：O（log n）
func findString2(words []string, s string) int {
	left, right := 0, len(words)
	for left < right {
		mid := left + (right-left)/2

		for mid > left && words[mid] == "" {
			mid--
		}

		if words[mid] > s {
			right = mid
		} else if words[mid] < s {
			left = mid + 1
		} else {
			return mid
		}
	}

	return -1
}

